<head>
  <meta charset="UTF-8">
  <title>PXLinux Boot from Pixels - PXScreenVM</title>
  <style>
    body { background: black; color: lime; font-family: monospace; }
    canvas { image-rendering: pixelated; border: 1px solid #0f0; }
    #terminal { margin-top: 1em; white-space: pre-wrap; }
  </style>
</head>
<body>
  <h1>PXLinux + PXScreenVM</h1>
  <canvas id="pxcanvas" width="512" height="512"></canvas>
  <div id="terminal">[boot] PXScreenVM started...</div>
  <script>
    
// PXScreenVM - Minimal Pixel Instruction Executor
function decodeRGBtoInstruction(r, g, b) {
  if (r === 255 && g === 0 && b === 0) return '[PXVM] HALT';
  if (r === 0 && g === 255 && b === 0) return '[PXVM] PRINT_HELLO';
  if (r === 0 && g === 0 && b === 255) return '[PXVM] SET_PIXEL_GREEN';
  return '[PXVM] NOOP';
}

function executeCanvasInstructions(canvas, terminal) {
  const ctx = canvas.getContext('2d');
  const imgData = ctx.getImageData(0, 0, canvas.width, canvas.height);
  const data = imgData.data;
  for (let y = 0; y < canvas.height; y++) {
    for (let x = 0; x < canvas.width; x++) {
      const idx = (y * canvas.width + x) * 4;
      const r = data[idx], g = data[idx+1], b = data[idx+2];
      const output = decodeRGBtoInstruction(r, g, b);
      if (output !== '[PXVM] NOOP') {
        terminal.innerText += '\n(' + x + ',' + y + ') ' + output;
      }
    }
  }
}

    const terminal = document.getElementById('terminal');
    const img = new Image();
    img.onload = function() {
      ctx.drawImage(img, 0, 0);
      setTimeout(() => executeCanvasInstructions(canvas, terminal), 1000);
